    ar: 'تحتاج هذه الدراسة إلى نافذة متصفح خفي/خاص، وهذه النافذة ليست كذلك. يمكنك إصلاح هذا. باستخدام أي متصفح آخر غير سفاري، افتح نافذة خفية، وشغل رابط الدراسة في تلك النافذة.\n\nالتفسير: جميع المتصفحات الرئيسية تسمح لك بفتح نافذة في وضع التصفح الخفي، على الرغم من أن الاسم يختلف، مثل "التصفح الخفي"، "InPrivate"، "التصفح الخاص"، أو "نافذة خاصة". جميع المتصفحات باستثناء سفاري تبلغ عما إذا كانت صفحة الويب في وضع التصفح الخفي. سفاري دائماً يقول لا. يتم استخدام وضع التصفح الخفي عادةً للخصوصية. يستخدم EasyEyes هذا الوضع لتسهيل الوصول إلى مكتبة EasyEyes Firebase، والتي تحتاجها لمعايرة الصوت.',
