    fr: 'Cette étude nécessite une fenêtre incognito/privée, et cette fenêtre ne l\'est pas. Vous pouvez corriger cela. En utilisant un navigateur autre que Safari, ouvrez une fenêtre incognito et exécutez le lien de l\'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d\'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple "Incognito", "InPrivate", "Navigation privée" ou "Fenêtre privée". Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari dit toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l\'utilise pour faciliter l\'accès à la bibliothèque EasyEyes Firebase, nécessaire pour l\'étalonnage du son.',
