    "en-UK":
      "As stated in its description, this study requires an incognito/private window, and this window isn't. You can fix this. Using any browser other than Safari, open an incognito window, and run the study link in that window.\n\nEXPLANATION: All major browsers allow you to open a window in incognito mode, though the name varies, e.g. “Incognito”, “InPrivate”, “Private Browsing”, or “Private Window”. All browsers except Safari report whether the web page is in incognito mode. Safari always says no. Incognito mode is typically used for privacy. EasyEyes uses it to ease access to the EasyEyes Firebase library, which is needed for sound calibration.",
    fi: "Loading...",
    fr: 'Comme indiqué dans sa description, cette étude nécessite une fenêtre incognito/privée, et cette fenêtre ne l\'est pas. Vous pouvez corriger cela. En utilisant un navigateur autre que Safari, ouvrez une fenêtre incognito et exécutez le lien de l\'étude dans cette fenêtre.\n\nEXPLICATION : Tous les principaux navigateurs vous permettent d\'ouvrir une fenêtre en mode incognito, bien que le nom varie, par exemple "Incognito", "InPrivate", "Navigation privée" ou "Fenêtre privée". Tous les navigateurs sauf Safari indiquent si la page web est en mode incognito. Safari dit toujours non. Le mode incognito est généralement utilisé pour la confidentialité. EasyEyes l\'utilise pour faciliter l\'accès à la bibliothèque Firebase d\'EasyEyes, qui est nécessaire pour l\'étalonnage du son.',
    de: "Loading...",
    el: "Loading...",
    he: "Loading...",
    hi: "Loading...",
    hu: "Loading...",
    is: "Loading...",
    id: "Loading...",
    it: 'Come indicato nella sua descrizione, questo studio richiede una finestra in incognito/privata, e questa finestra non lo è. Puoi risolvere questo problema. Utilizzando un browser diverso da Safari, apri una finestra in incognito ed esegui il link dello studio in quella finestra.\n\nSPIEGAZIONE: Tutti i principali browser consentono di aprire una finestra in modalità incognito, anche se il nome varia, ad esempio "Incognito", "InPrivate", "Navigazione Privata" o "Finestra Privata". Tutti i browser tranne Safari segnalano se la pagina web è in modalità incognito. Safari dice sempre di no. La modalità incognito è tipicamente utilizzata per la privacy. EasyEyes la utilizza per facilitare l\'accesso alla libreria Firebase di EasyEyes, necessaria per la calibrazione del suono.',
    ja: "Loading...",
