    ar: 'هناك حاجة إلى معرف فريد لربط البيانات عبر الجلسات. هذا الكمبيوتر شارك سابقًا في جلسة على **ddd** مع معرف EasyEyes "**sss**". اضغط على موافق إذا كان هذا أنت. خلاف ذلك، إذا كان لديك ملف معرف EasyEyes، اضغط على زر اختيار الملف أدناه لفتحه. (يبدأ اسم الملف بـ "EasyEyes"، وينتهي بـ ".txt"، وعادة ما يكون في مجلد التنزيلات الخاص بك.) إذا لم يكن لديك ملف، ولكنك تعرف معرف EasyEyes الخاص بك، فاكتبه. خلاف ذلك، قم بإنشاء معرف خاص بك، والذي يمكن أن يكون أي سلسلة أبجدية رقمية (بالإضافة إلى الشرطة السفلية "_"، والشرطة "-"، والنقطة ".") لا تقل عن 5 أحرف. يمكن أن يكون اسمك، إذا أردت. سنقوم بتذكره لك على هذا الكمبيوتر، ولكن إذا ذهبت إلى كمبيوتر آخر، يرجى أخذ ملف معرف EasyEyes الخاص بك (أحدث ملف في مجلد التنزيلات الخاص بك)، أو على الأقل اكتب معرف EasyEyes الخاص بك. استخدمه في كل مرة لربط بياناتك من جلسة إلى أخرى.',
