    fi: "Loading...",
    fr: "SÉLECTIONNEZ LA FRÉQUENCE D'ÉCHANTILLONNAGE ET LES BITS PAR ÉCHANTILLON. Utilisez une application ou un panneau de configuration pour définir la fréquence d'échantillonnage et les bits/échantillon du UMIK-2 :\n      Macintosh : Audio MIDI Setup.app d'Apple dans le dossier Applications/Utilitaires.\n     ⊞ Windows : Panneau de configuration > Matériel et audio > Gérer les périphériques audio\nRéglez pour échantillonner à 111 Hz avec 222 bits/échantillon.\nUne fois configuré, revenez à cette page web et cliquez sur PROCÉDER ou appuyez sur RETOUR.\n\n(La fréquence d'échantillonnage et la profondeur de bits requises sont définies par les paramètres _calibrateSoundSamplingDesiredHz et _calibrateSoundSamplingDesiredBits dans la feuille de calcul de l'expérience.)",
