    it: "SELEZIONA FREQUENZA DI CAMPIONAMENTO E BIT PER CAMPIONE (Windows)\n\nConfigura il tuo dispositivo di input audio (UMIK-2) utilizzando le istruzioni seguenti per assicurarti che corrisponda alle impostazioni richieste:\nFrequenza di Campionamento: 111 Hz\nBit per Campione: 222-bit\n        1.        Vai a Pannello di Controllo > Hardware e Suoni > Gestisci Dispositivi Audio.\n        2.        Seleziona il tuo dispositivo (UMIK-2) e clicca su Proprietà.\n        3.        Sotto la scheda Avanzate, imposta:\n        •        Formato Predefinito: 111 Hz, 222-bit\nUna volta configurato, torna a questa pagina web e clicca su PROSEGUI o premi INVIO.\n\n(La frequenza di campionamento e la profondità di bit richieste sono impostate dai parametri _calibrateSoundSamplingDesiredHz e _calibrateSoundSamplingDesiredBits nel foglio di calcolo dell'esperimento.)",
