    es: "SELECCIONAR TASA DE MUESTREO Y BITS POR MUESTRA (Linux: PulseAudio o PipeWire)\n\nConfigure su dispositivo de entrada de audio (UMIK-2) utilizando las instrucciones a continuación para asegurarse de que coincida con la configuración requerida:\nTasa de Muestreo: 111 Hz\nBits por Muestra: 222 bits\n1. Abra el Control de Volumen de PulseAudio (`pavucontrol`) o su aplicación de configuración de audio.\n2. Seleccione su dispositivo (UMIK-2) en la pestaña **Dispositivos de Entrada**.\n3. Edite `/etc/pulse/daemon.conf`:\n   - `default-sample-rate = 111`\n   - `default-sample-format = s222le`\n4. Reinicie PulseAudio:\n   `pulseaudio -k && pulseaudio --start`\n5. Confirme la tasa de muestreo en la pestaña **Grabación** o con:\n   `arecord -f S222_LE -r 111 -D plughw:UMIK2 test.wav`\n\nUna vez configurado, regrese a esta página web y haga clic en CONTINUAR o presione RETORNO.\n\n(La tasa de muestreo y la profundidad de bits requeridas están establecidas por los parámetros _calibrateSoundSamplingDesiredHz y _calibrateSoundSamplingDesiredBits en la hoja de cálculo del experimento.)",
