    ro: "Loading...",
    ru: "Loading...",
    sr: "Loading...",
    es: "Participar en este estudio le permite hacer una contribución significativa al avance de la investigación auditiva en línea al proporcionar datos esenciales sobre la diversa gama de micrófonos de teléfonos inteligentes y altavoces de computadoras. Esta investigación tiene como objetivo crear una biblioteca detallada de perfiles de dispositivos que mejorará la precisión de las pruebas auditivas realizadas en línea. El esquema depende de emparejar el micrófono del teléfono del usuario con un micrófono calibrado en laboratorio. Cada modelo tiene un micrófono diferente, por lo que es crucial especificar el modelo. Entendiendo que la privacidad es una prioridad, tenga la seguridad de que esta encuesta solo retiene los números de modelo de teléfonos y computadoras. Estos números de modelo no están vinculados a ninguna información personal y no lo identifican.",
