    ru: "Loading...",
    sr: "Loading...",
    es: "CREAR UNA PLATAFORMA Necesitamos una plataforma elevada (una superficie nivelada) para apoyar tu teléfono. Esta plataforma puede ser un vaso, taza, frasco, lata, caja o una pila de libros.\n\nCOLOCAR LA PLATAFORMA 1. Si estás usando una laptop con altavoces integrados en el teclado, coloca tu plataforma en la mesa entre tú y tu computadora, cerca del teclado.\n\n2. Si tu computadora tiene altavoces ubicados en otro lugar, coloca tu plataforma en la mesa entre tú y los altavoces de manera que el extremo lejano del teléfono en tu plataforma esté a medio camino entre los altavoces y tus ojos cuando estés usando tu computadora.\n\nAJUSTAR LA ALTURA DE LA PLATAFORMA Puedes apilar objetos, como libros y un vaso, para alcanzar la altura adecuada. Haz que tu plataforma sea lo suficientemente alta para que esté a una altura intermedia entre los altavoces y donde están tus ojos cuando estás sentado en la mesa usando tu computadora.\n\n¿LISTO? Cuando tu plataforma esté lista, presiona RETURN o haz clic en PROCEED para continuar.",
